import React from 'react';
import './ServicePage.css'; 
import backgroundImage from '../../assets/home_pic.png';

function ServicesPage() {
    return (
        <header className="masthead vh-100 d-flex align-items-center text-center">
            <div className="container">
                <div className="row justify-content-center">
                    <div className="col-12">
                        {/* Blurry transparent box */}
                        <div className="blurry-box">
                            <h1 className="display-3 text-white fw-bold">Our Services</h1>
                            <p className="lead text-white mt-3"></p>
                            <ul>
                                <li>
                                    <h4>Delivery:</h4>
                                    <h5>need to deliver packages between different cities?<br />We got your back, no need for expensive shipment, we will deliver it for you!</h5>
                                </li>
                                <li>
                                    <h4>Convenient Taxi Rides:</h4>
                                    <h5>Need a ride?<br />TaxiGo connects you with nearby taxis instantly. No more waiting on street corners or searching for cab stands.<br />It's like having a personal chauffeur at your fingertips.</h5>
                                </li>
                            </ul>
                        </div>
                    </div>
                </div>
                <div className="background-overlay"></div>
            </div>
            <div className="background-image" style={{ backgroundImage: `url(${backgroundImage})` }}></div>
        </header>
    );
}

export default ServicesPage;
